import React, {Component} from 'react';
import Flight from "./Flight";
import  './Searcher.css';


class Searcher extends Component {
    render() {
        return (

            <table className='table'>
                <thead className='header'>
                    <th className='headerCell' >Departure time</th>
                    <th className='headerCell'>Arrival time</th>
                    <th className='headerCell'>Price</th>
                </thead>
                <tbody>
                {this.props.datas.map((data) => (
                    <tr className='bodyCell'>
                        <td>{data.departure_data}</td>
                        <td>{data.arrival_data}</td>
                        <td>{data.price} USD</td>
                    </tr>
                ))}
                </tbody>
            </table>
        )
    }
}

export default Searcher;
